import React from 'react';
import MyContext from './my_context.js';





class PriceTrending extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            change: '0.0',
        };
    }

	render() {
		return (
			<div>
				<MyContext.Consumer>
					{
						(market_data,  market_data_new) => {
							// console.log(market_data.data)
							return (
								<div>
									market_data_new.change(market_data.data)
								</div>
							)
						}
					}
				</MyContext.Consumer>
			</div>
		);
	}
}

export default PriceTrending;
